        public static async Task<List<ClashWar>> GetWarLog(int numberOfWars=5) {
            string responseString = String.Empty;
            string path = String.Format("{0}{1}/{2}{3}",
                apiPath,clansPath,clanTag,warPath);
            JsonDeserialize warLog = null;
            AddHeaders();
            HttpResponseMessage response = await client.GetAsync(path);
            if (response.IsSuccessStatusCode)
            {
                responseString = await response.Content.ReadAsStringAsync();
                warLog = Newtonsoft.Json.JsonConvert.DeserializeObject<JsonDeserialize>(responseString);
                
            }
                            
            return warLog.items;
            //return responseString;
        }
